INSERT INTO "public"."target_profiles" ("id", "component_id", "uniprot_id", "gene_symbol", "ensembl_id", "protein_name", "organism", "function_summary", "expression", "associations", "clinical", "safety_signals", "external_refs", "checksum", "created_at", "updated_at") VALUES ('0010e29e-f881-48b3-8f72-796135607aa3', null, 'P33527', 'ABCC1', null, 'Multidrug resistance-associated protein 1', 'Homo sapiens', 'Mediates export of organic anions and drugs from the cytoplasm (PubMed:10064732, PubMed:11114332, PubMed:16230346, PubMed:7961706, PubMed:9281595). Mediates ATP-dependent transport of glutathione and glutathione conjugates, leukotriene C4, estradiol-17-beta-o-glucuronide, methotrexate, antiviral drugs and other xenobiotics (PubMed:10064732, PubMed:11114332, PubMed:16230346, PubMed:7961706, PubMed:9281595). Confers resistance to anticancer drugs by decreasing accumulation of drug in cells, and by mediating ATP- and GSH-dependent drug export (PubMed:9281595). Hydrolyzes ATP with low efficiency (PubMed:16230346). Catalyzes the export of sphingosine 1-phosphate from mast cells independently of their degranulation (PubMed:17050692). Participates in inflammatory response by allowing export of leukotriene C4 from leukotriene C4-synthesizing cells (By similarity). Mediates ATP-dependent, GSH-independent cyclic GMP-AMP (cGAMP) export (PubMed:36070769). Thus, by limiting intracellular cGAMP concentrations negatively regulates the cGAS-STING pathway (PubMed:36070769). Exports S-geranylgeranyl-glutathione (GGG) in lymphoid cells and stromal compartments of lymphoid organs. ABCC1 (via extracellular transport) with GGT5 (via GGG catabolism) establish GGG gradients within lymphoid tissues to position P2RY8-positive lymphocytes at germinal centers in lymphoid follicles and restrict their chemotactic transmigration from blood vessels to the bone marrow parenchyma (By similarity). Mediates basolateral export of GSH-conjugated R- and S-prostaglandin A2 diastereomers in polarized epithelial cells (PubMed:9426231)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL3004"], "DrugBank": ["DB05812", "DB13783", "DB00345", "DB00701", "DB01072", "DB01076", "DB00171", "DB15719", "DB12319", "DB04851", "DB09061", "DB14737", "DB02659", "DB00845", "DB00286", "DB00115", "DB00970", "DB00694", "DB09213", "DB00586", "DB01248", "DB00997", "DB00470", "DB00445", "DB00773", "DB08868", "DB00693", "DB00499", "DB01645", "DB00143", "DB01016", "DB00365", "DB01050", "DB01177", "DB00619", "DB00224", "DB00328", "DB00762", "DB00602", "DB00709", "DB08855", "DB14009", "DB00563", "DB00834", "DB01204", "DB02375", "DB14011", "DB03467", "DB01165", "DB01229", "DB01174", "DB01708", "DB01032", "DB00396", "DB04216", "DB03825", "DB01045", "DB00503", "DB06176", "DB01232", "DB06335", "DB01138", "DB04348", "DB09161", "DB14962", "DB05294", "DB08881", "DB00661", "DB00570", "DB00541", "DB00399"]}', '038d3519dfa725b418ba3c904d88daa7', '2026-01-07 09:53:46.395454+00', '2026-01-07 09:53:46.269132+00'), ('0331dbd2-9d92-4bf7-a57c-6e024a4e3892', null, 'P16422', 'EPCAM', 'ENST00000263735.9', 'Epithelial cell adhesion molecule', 'Homo sapiens', 'May act as a physical homophilic interaction molecule between intestinal epithelial cells (IECs) and intraepithelial lymphocytes (IELs) at the mucosal epithelium for providing immunological barrier as a first line of defense against mucosal infection. Plays a role in embryonic stem cells proliferation and differentiation. Up-regulates the expression of FABP5, MYC and cyclins A and E', '{}', '{}', '{}', '{}', '{"pdb": ["4MZV", "6I07"], "hgnc": "HGNC:11529", "ensembl": ["ENST00000263735.9"], "ncbi_gene": "4072"}', '2f8e8274318604dd', '2026-01-07 01:48:23.777949+00', '2026-01-07 01:48:23.777942+00'), ('05858db1-e6fe-466c-8f87-253adbddfff8', null, 'P00533', 'EGFR', 'ENST00000275493.7', 'Epidermal growth factor receptor', 'Homo sapiens', 'Receptor tyrosine kinase binding ligands of the EGF family and activating several signaling cascades to convert extracellular cues into appropriate cellular responses (PubMed:10805725, PubMed:27153536, PubMed:2790960, PubMed:35538033). Known ligands include EGF, TGFA/TGF-alpha, AREG, epigen/EPGN, BTC/betacellulin, epiregulin/EREG and HBEGF/heparin-binding EGF (PubMed:12297049, PubMed:15611079, PubMed:17909029, PubMed:20837704, PubMed:27153536, PubMed:2790960, PubMed:7679104, PubMed:8144591, PubMed:9419975). Ligand binding triggers receptor homo- and/or heterodimerization and autophosphorylation on key cytoplasmic residues. The phosphorylated receptor recruits adapter proteins like GRB2 which in turn activates complex downstream signaling cascades. Activates at least 4 major downstream signaling cascades including the RAS-RAF-MEK-ERK, PI3 kinase-AKT, PLCgamma-PKC and STATs modules (PubMed:27153536). May also activate the NF-kappa-B signaling cascade (PubMed:11116146). Also directly phosphorylates other proteins like RGS16, activating its GTPase activity and probably coupling the EGF receptor signaling to the G protein-coupled receptor signaling (PubMed:11602604). Also phosphorylates MUC1 and increases its interaction with SRC and CTNNB1/beta-catenin (PubMed:11483589). Positively regulates cell migration via interaction with CCDC88A/GIV which retains EGFR at the cell membrane following ligand stimulation, promoting EGFR signaling which triggers cell migration (PubMed:20462955). Plays a role in enhancing learning and memory performance (By similarity). Plays a role in mammalian pain signaling (long-lasting hypersensitivity) (By similarity)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL203"], "DrugBank": ["DB15327", "DB08916", "DB18840", "DB16640", "DB03496", "DB16695", "DB06021", "DB12318", "DB11665", "DB12267", "DB05424", "DB00002", "DB12174", "DB11963", "DB11731", "DB00530", "DB12966", "DB10772", "DB12010", "DB00317", "DB11737", "DB04988", "DB01259", "DB16768", "DB16216", "DB00281", "DB05101", "DB06110", "DB04862", "DB16390", "DB12682", "DB08462", "DB12036", "DB16250", "DB09559", "DB11828", "DB00727", "DB13164", "DB09330", "DB01269", "DB08339", "DB07662", "DB05524", "DB12114", "DB08052", "DB14993", "DB05374", "DB11907", "DB07602", "DB00398", "DB14944", "DB05294", "DB05944", "DB04879", "DB12202", "DB15035"]}', 'dc03de9611ea48b109e9760ca2f84be6', '2026-01-07 01:48:10.238766+00', '2026-01-08 02:09:11.990587+00'), ('05e17d24-0ff8-460e-941e-36cc430238fd', null, 'Q9NZQ7', 'CD274', 'ENST00000381573.8', 'Programmed cell death 1 ligand 1', 'Homo sapiens', 'Plays a critical role in induction and maintenance of immune tolerance to self (PubMed:11015443, PubMed:28813410, PubMed:28813417, PubMed:31399419). As a ligand for the inhibitory receptor PDCD1/PD-1, modulates the activation threshold of T-cells and limits T-cell effector response (PubMed:11015443, PubMed:28813410, PubMed:28813417, PubMed:36727298). Through a yet unknown activating receptor, may costimulate T-cell subsets that predominantly produce interleukin-10 (IL10) (PubMed:10581077). Can also act as a transcription coactivator: in response to hypoxia, translocates into the nucleus via its interaction with phosphorylated STAT3 and promotes transcription of GSDMC, leading to pyroptosis (PubMed:32929201)', '{}', '{}', '{}', '{}', '{"pdb": ["3BIK", "3BIS", "3FN3", "3SBW", "4Z18", "4ZQK", "5C3T", "5GGT", "5GRJ", "5IUS", "5J89", "5J8O", "5JDR", "5JDS", "5N2D", "5N2F", "5NIU", "5O45", "5O4Y", "5X8L", "5X8M", "5XJ4", "5XXY", "6L8R", "6NM7", "6NM8", "6NNV", "6NOJ", "6NOS", "6NP9", "6PV9", "6R3K", "6RPG", "6VQN", "6YCR", "7BEA", "7C88", "7CZD", "7DCV", "7DY7", "7NLD", "7OUN", "7SJQ", "7TPS", "7UX5", "7UXO", "7UXP", "7UXQ", "7VUN", "7XAD", "7XAE", "7XYQ", "7YDS", "8ALX", "8AOK", "8AOM", "8JBA", "8K5N", "8OR1", "8P1O", "8R6Q", "8RPB", "8XR5", "9INU"], "hgnc": "HGNC:17635", "ensembl": ["ENST00000381573.8", "ENST00000381577.4"], "ncbi_gene": "29126"}', '39ecc3fdcced179b', '2026-01-07 01:48:33.616039+00', '2026-01-07 01:48:33.616032+00'), ('0bdd8e48-c618-4f27-8d6e-e03bda3b9501', null, 'Q96NY8', 'NECTIN4', null, 'Nectin-4', 'Homo sapiens', 'Seems to be involved in cell adhesion through trans-homophilic and -heterophilic interactions, the latter including specifically interactions with NECTIN1. Does not act as receptor for alpha-herpesvirus entry into cells', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL3712928"], "DrugBank": ["DB13007"]}', '404faa34e9febb9ee68d466da20e7cc7', '2026-01-08 01:33:45.936403+00', '2026-01-08 02:09:11.225595+00'), ('1e006c9f-5dcf-4fa8-b6cc-a0c9297540e8', null, 'O95905', 'ECD', null, 'Protein ecdysoneless homolog', 'Homo sapiens', 'Regulator of p53/TP53 stability and function. Inhibits MDM2-mediated degradation of p53/TP53 possibly by cooperating in part with TXNIP (PubMed:16849563, PubMed:23880345). May be involved transcriptional regulation. In vitro has intrinsic transactivation activity enhanced by EP300. May be a transcriptional activator required for the expression of glycolytic genes (PubMed:19919181, PubMed:9928932). Involved in regulation of cell cycle progression. Proposed to disrupt Rb-E2F binding leading to transcriptional activation of E2F proteins (PubMed:19640839). The cell cycle -regulating function may depend on its RUVBL1-mediated association with the R2TP complex (PubMed:26711270). May play a role in regulation of pre-mRNA splicing (PubMed:24722212). Participates together with DDX39A in mRNA nuclear export (PubMed:33941617)', '{}', '{}', '{}', '{}', '{}', 'd7fa6aa308f28d4ddf01c0cbbf7ed750', '2026-01-07 09:25:06.733859+00', '2026-01-07 09:25:02.154511+00'), ('1e2bb906-722b-40f6-a82f-c89de2261061', null, 'O14910', 'LIN7A', null, 'Protein lin-7 homolog A', 'Homo sapiens', 'Plays a role in establishing and maintaining the asymmetric distribution of channels and receptors at the plasma membrane of polarized cells. Forms membrane-associated multiprotein complexes that may regulate delivery and recycling of proteins to the correct membrane domains. The tripartite complex composed of LIN7 (LIN7A, LIN7B or LIN7C), CASK and APBA1 associates with the motor protein KIF17 to transport vesicles containing N-methyl-D-aspartate (NMDA) receptor subunit NR2B along microtubules (By similarity). This complex may have the potential to couple synaptic vesicle exocytosis to cell adhesion in brain. Ensures the proper localization of GRIN2B (subunit 2B of the NMDA receptor) to neuronal postsynaptic density and may function in localizing synaptic vesicles at synapses where it is recruited by beta-catenin and cadherin. Required to localize Kir2 channels, GABA transporter (SLC6A12) and EGFR/ERBB1, ERBB2, ERBB3 and ERBB4 to the basolateral membrane of epithelial cells', '{}', '{}', '{}', '{}', '{}', 'f1587181613022fb5a477bfd9397bdbc', '2026-01-07 09:25:05.631314+00', '2026-01-07 09:25:01.052726+00'), ('1facadfd-fff9-41ba-b38c-f6353a9f0356', null, 'A0A2U7XUX1', 'ANTXRL', null, '', 'Homo sapiens', '', '{}', '{}', '{}', '{}', '{}', '455cfa28c97cb3ccfe79484ca2f36bb3', '2026-01-07 09:53:46.76073+00', '2026-01-07 09:53:46.615078+00'), ('203d5553-76b7-4b9d-80d5-91a7a2b5e2e7', null, 'P04637', 'TP53', 'ENSG00000141510', 'Cellular tumor antigen p53', 'Homo sapiens', 'Multifunctional transcription factor that induces cell cycle arrest, DNA repair or apoptosis upon binding to its target DNA sequence (PubMed:11025664, PubMed:12524540, PubMed:12810724, PubMed:15186775, PubMed:15340061, PubMed:17317671, PubMed:17349958, PubMed:19556538, PubMed:20673990, PubMed:20959462, PubMed:22726440, PubMed:24051492, PubMed:24652652, PubMed:35618207, PubMed:36634798, PubMed:38653238, PubMed:9840937). Acts as a tumor suppressor in many tumor types; induces growth arrest or apoptosis depending on the physiological circumstances and cell type (PubMed:11025664, PubMed:12524540, PubMed:12810724, PubMed:15186775, PubMed:15340061, PubMed:17189187, PubMed:17317671, PubMed:17349958, PubMed:19556538, PubMed:20673990, PubMed:20959462, PubMed:22726440, PubMed:24051492, PubMed:24652652, PubMed:38653238, PubMed:9840937). Negatively regulates cell division by controlling expression of a set of genes required for this process (PubMed:11025664, PubMed:12524540, PubMed:12810724, PubMed:15186775, PubMed:15340061, PubMed:17317671, PubMed:17349958, PubMed:19556538, PubMed:20673990, PubMed:20959462, PubMed:22726440, PubMed:24051492, PubMed:24652652, PubMed:9840937). One of the activated genes is an inhibitor of cyclin-dependent kinases. Apoptosis induction seems to be mediated either by stimulation of BAX and FAS antigen expression, or by repression of Bcl-2 expression (PubMed:12524540, PubMed:17189187). Its pro-apoptotic activity is activated via its interaction with PPP1R13B/ASPP1 or TP53BP2/ASPP2 (PubMed:12524540). However, this activity is inhibited when the interaction with PPP1R13B/ASPP1 or TP53BP2/ASPP2 is displaced by PPP1R13L/iASPP (PubMed:12524540). In cooperation with mitochondrial PPIF is involved in activating oxidative stress-induced necrosis; the function is largely independent of transcription. Induces the transcription of long intergenic non-coding RNA p21 (lincRNA-p21) and lincRNA-Mkln1. LincRNA-p21 participates in TP53-dependent transcriptional repression leading to apoptosis and seems to have an effect on cell-cycle regulation. Implicated in Notch signaling cross-over. Prevents CDK7 kinase activity when associated to CAK complex in response to DNA damage, thus stopping cell cycle progression. Isoform 2 enhances the transactivation activity of isoform 1 from some but not all TP53-inducible promoters. Isoform 4 suppresses transactivation activity and impairs growth suppression mediated by isoform 1. Isoform 7 inhibits isoform 1-mediated apoptosis. Regulates the circadian clock by repressing CLOCK-BMAL1-mediated transcriptional activation of PER2 (PubMed:24051492)', '{"hpa": {"updated_at": "2026-01-07T09:44:17.162031", "rna_specificity": "Low tissue specificity", "blood_expression": {}, "cancer_expression": {}, "tissue_expression": {}, "subcellular_location": ["Nucleoplasm", "Vesicles", "Cytosol"]}}', '[{"score": 0.876057