bcd6-e8e2c09e7438', null, 'P21860', 'ERBB3', 'ENST00000267101.8', 'Receptor tyrosine-protein kinase erbB-3', 'Homo sapiens', 'Tyrosine-protein kinase that plays an essential role as cell surface receptor for neuregulins. Binds to neuregulin-1 (NRG1) and is activated by it; ligand-binding increases phosphorylation on tyrosine residues and promotes its association with the p85 subunit of phosphatidylinositol 3-kinase (PubMed:20682778). May also be activated by CSPG5 (PubMed:15358134). Involved in the regulation of myeloid cell differentiation (PubMed:27416908)', '{}', '{}', '{}', '{}', '{"pdb": ["1M6B", "2L9U", "3KEX", "3LMG", "3P11", "4LEO", "4P59", "4RIW", "4RIX", "4RIY", "5CUS", "5O4O", "5O7P", "6KBI", "6OP9", "7BHE", "7BHF", "7D85", "7MN5", "7MN6", "7MN8"], "hgnc": "HGNC:3431", "ensembl": ["ENST00000267101.8", "ENST00000411731.6", "ENST00000415288.6", "ENST00000551242.5", "ENST00000683018.1", "ENST00000683059.1", "ENST00000683164.1"], "ncbi_gene": "2065"}', '3b7f42e3ad542716', '2026-01-07 01:48:12.281641+00', '2026-01-07 01:48:12.28163+00'), ('37b0fa69-f72d-46de-8b33-7d9bcdf54dea', null, 'Q6GMX6', 'IGH@', null, '', 'Homo sapiens', '', '{}', '{}', '{}', '{}', '{}', '61d3f642d4440fea1d8892fc0c4e68f7', '2026-01-07 09:25:09.17673+00', '2026-01-07 09:25:04.605187+00'), ('39340544-cddd-473c-80c4-94aae5cd4c71', null, 'P35968', 'KDR', 'ENST00000263923.5', 'Vascular endothelial growth factor receptor 2', 'Homo sapiens', 'Tyrosine-protein kinase that acts as a cell-surface receptor for VEGFA, VEGFC and VEGFD. Plays an essential role in the regulation of angiogenesis, vascular development, vascular permeability, and embryonic hematopoiesis. Promotes proliferation, survival, migration and differentiation of endothelial cells. Promotes reorganization of the actin cytoskeleton. Isoforms lacking a transmembrane domain, such as isoform 2 and isoform 3, may function as decoy receptors for VEGFA, VEGFC and/or VEGFD. Isoform 2 plays an important role as negative regulator of VEGFA- and VEGFC-mediated lymphangiogenesis by limiting the amount of free VEGFA and/or VEGFC and preventing their binding to FLT4. Modulates FLT1 and FLT4 signaling by forming heterodimers. Binding of vascular growth factors to isoform 1 leads to the activation of several signaling cascades. Activation of PLCG1 leads to the production of the cellular signaling molecules diacylglycerol and inositol 1,4,5-trisphosphate and the activation of protein kinase C. Mediates activation of MAPK1/ERK2, MAPK3/ERK1 and the MAP kinase signaling pathway, as well as of the AKT1 signaling pathway. Mediates phosphorylation of PIK3R1, the regulatory subunit of phosphatidylinositol 3-kinase, reorganization of the actin cytoskeleton and activation of PTK2/FAK1. Required for VEGFA-mediated induction of NOS2 and NOS3, leading to the production of the signaling molecule nitric oxide (NO) by endothelial cells. Phosphorylates PLCG1. Promotes phosphorylation of FYN, NCK1, NOS3, PIK3R1, PTK2/FAK1 and SRC', '{}', '{}', '{}', '{}', '{"pdb": ["1VR2", "1Y6A", "1Y6B", "1YWN", "2M59", "2MET", "2MEU", "2OH4", "2P2H", "2P2I", "2QU5", "2QU6", "2RL5", "2X1W", "2X1X", "2XIR", "3B8Q", "3B8R", "3BE2", "3C7Q", "3CJF", "3CJG", "3CP9", "3CPB", "3CPC", "3DTW", "3EFL", "3EWH", "3KVQ", "3S35", "3S36", "3S37", "3U6J", "3V2A", "3V6B", "3VHE", "3VHK", "3VID", "3VNT", "3VO3", "3WZD", "3WZE", "4AG8", "4AGC", "4AGD", "4ASD", "4ASE", "5EW3", "5OYJ", "6GQO", "6GQP", "6GQQ", "6XVJ", "6XVK"], "hgnc": "HGNC:6307", "ensembl": ["ENST00000263923.5"], "ncbi_gene": "3791"}', 'b5d08818a34451be', '2026-01-07 01:48:37.677971+00', '2026-01-07 01:48:37.677963+00'), ('3ad94fa5-dd6b-49eb-920f-0bd8e6c68caa', null, 'Q01973', 'ROR1', null, 'Inactive tyrosine-protein kinase transmembrane receptor ROR1', 'Homo sapiens', 'Has very low kinase activity in vitro and is unlikely to function as a tyrosine kinase in vivo (PubMed:25029443). Receptor for ligand WNT5A which activate downstream NFkB signaling pathway and may result in the inhibition of WNT3A-mediated signaling (PubMed:25029443, PubMed:27162350). In inner ear, crucial for spiral ganglion neurons to innervate auditory hair cells (PubMed:27162350). Via IGFBP5 ligand, forms a complex with ERBB2 to enhance CREB oncogenic signaling (PubMed:36949068)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL4665585"]}', 'ba0514eb1114681dfaebbae4226cf350', '2026-01-07 09:25:03.768022+00', '2026-01-07 09:24:59.140526+00'), ('3e07b7c9-5d37-4268-8d3b-4b055b1a79a0', null, 'P48061', 'CXCL12', 'ENST00000343575.11', 'Stromal cell-derived factor 1', 'Homo sapiens', 'Chemoattractant active on T-lymphocytes and monocytes but not neutrophils. Activates the C-X-C chemokine receptor CXCR4 to induce a rapid and transient rise in the level of intracellular calcium ions and chemotaxis. SDF-1-beta(3-72) and SDF-1-alpha(3-67) show a reduced chemotactic activity. Binding to cell surface proteoglycans seems to inhibit formation of SDF-1-alpha(3-67) and thus to preserve activity on local sites. Also binds to atypical chemokine receptor ACKR3, which activates the beta-arrestin pathway and acts as a scavenger receptor for SDF-1. Binds to the allosteric site (site 2) of integrins and activates integrins ITGAV:ITGB3, ITGA4:ITGB1 and ITGA5:ITGB1 in a CXCR4-independent manner (PubMed:29301984). Acts as a positive regulator of monocyte migration and a negative regulator of monocyte adhesion via the LYN kinase. Stimulates migration of monocytes and T-lymphocytes through its receptors, CXCR4 and ACKR3, and decreases monocyte adherence to surfaces coated with ICAM-1, a ligand for beta-2 integrins. SDF1A/CXCR4 signaling axis inhibits beta-2 integrin LFA-1 mediated adhesion of monocytes to ICAM-1 through LYN kinase. Inhibits CXCR4-mediated infection by T-cell line-adapted HIV-1. Plays a protective role after myocardial infarction. Induces down-regulation and internalization of ACKR3 expressed in various cells. Has several critical functions during embryonic development; required for B-cell lymphopoiesis, myelopoiesis in bone marrow and heart ventricular septum formation. Stimulates the proliferation of bone marrow-derived B-cell progenitors in the presence of IL7 as well as growth of stromal cell-dependent pre-B-cells (By similarity)', '{}', '{}', '{}', '{}', '{"pdb": ["1A15", "1QG7", "1SDF", "1VMC", "2J7Z", "2K01", "2K03", "2K04", "2K05", "2KEC", "2KED", "2KEE", "2KOL", "2N55", "2NWG", "2SDF", "3GV3", "3HP3", "4LMQ", "4UAI", "6SHR", "7SK3", "7SK4", "7SK5", "7SK6", "7SK7", "7SK8", "8K3Z", "8U4O"], "hgnc": "HGNC:10672", "ensembl": ["ENST00000343575.11", "ENST00000374426.6", "ENST00000374429.6", "ENST00000395793.7", "ENST00000395794.2"], "ncbi_gene": "6387"}', 'dd777cf9077ae271', '2026-01-07 01:48:25.760579+00', '2026-01-07 01:48:25.760568+00'), ('3e8bf33f-701b-4251-bc05-b113a3a7bee9', null, 'P04626', 'ERBB2', 'ENSG00000141736', 'Receptor tyrosine-protein kinase erbB-2', 'Homo sapiens', 'Protein tyrosine kinase that is part of several cell surface receptor complexes, but that apparently needs a coreceptor for ligand binding. Essential component of a neuregulin-receptor complex, although neuregulins do not interact with it alone. GP30 is a potential ligand for this receptor. Regulates outgrowth and stabilization of peripheral microtubules (MTs). Upon ERBB2 activation, the MEMO1-RHOA-DIAPH1 signaling pathway elicits the phosphorylation and thus the inhibition of GSK3B at cell membrane. This prevents the phosphorylation of APC and CLASP2, allowing its association with the cell membrane. In turn, membrane-bound APC allows the localization of MACF1 to the cell membrane, which is required for microtubule capture and stabilization', '{}', '[{"score": 0.756830139646167, "disease_id": "EFO_0003060", "disease_name": "non-small cell lung carcinoma", "datatype_scores": [{"id": "known_drug", "score": 0.9445005973126239}, {"id": "affected_pathway", "score": 0.607930797611621}, {"id": "literature", "score": 0.9888978664459614}, {"id": "somatic_mutation", "score": 0.714679841612059