}, {"score": 0.47818322938902674, "disease_id": "EFO_0000178", "disease_name": "gastric carcinoma", "datatype_scores": [{"id": "literature", "score": 0.7685227716180593}, {"id": "known_drug", "score": 0.12158615952232422}, {"id": "affected_pathway", "score": 0.8372509142179835}, {"id": "somatic_mutation", "score": 0.607930797611621}]}, {"score": 0.46976770495775616, "disease_id": "EFO_1000172", "disease_name": "cervical squamous cell carcinoma", "datatype_scores": [{"id": "literature", "score": 0.2483415863191789}, {"id": "somatic_mutation", "score": 0.6137708014546894}]}, {"score": 0.4693664154495713, "disease_id": "MONDO_0016596", "disease_name": "hyperphosphatasia-intellectual disability syndrome", "datatype_scores": [{"id": "genetic_association", "score": 0.7720721129667588}]}, {"score": 0.46641252510560094, "disease_id": "EFO_0002892", "disease_name": "thyroid carcinoma", "datatype_scores": [{"id": "known_drug", "score": 0.6488816916174039}, {"id": "literature", "score": 0.19550121657303182}, {"id": "somatic_mutation", "score": 0.4559480982087158}]}]', '{}', '{}', '{"ChEMBL": ["CHEMBL1824"], "DrugBank": ["DB08916", "DB06021", "DB12318", "DB11665", "DB12267", "DB05424", "DB12302", "DB12174", "DB11963", "DB12010", "DB04988", "DB01259", "DB14967", "DB00179", "DB04862", "DB12682", "DB06226", "DB11828", "DB07662", "DB06366", "DB12114", "DB12183", "DB14944", "DB11973", "DB00072", "DB05773", "DB11652", "DB05944", "DB15471", "DB15035"]}', '1073178f41ddf8b7c0d720c1b4be569c', '2026-01-07 01:48:07.98237+00', '2026-01-08 02:09:09.798989+00'), ('4cfaa378-4ac8-4099-aa96-3afe70285216', null, 'Q92673', 'SORL1', null, 'Sortilin-related receptor', 'Homo sapiens', 'Sorting receptor that directs several proteins to their correct location within the cell (Probable). Along with AP-1 complex, involved Golgi apparatus - endosome sorting (PubMed:17646382). Sorting receptor for APP, regulating its intracellular trafficking and processing into amyloidogenic-beta peptides. Retains APP in the trans-Golgi network, hence preventing its transit through late endosomes where amyloid beta peptides Abeta40 and Abeta42 are generated (PubMed:16174740, PubMed:16407538, PubMed:17855360, PubMed:24523320). May also sort newly produced amyloid-beta peptides to lysosomes for catabolism (PubMed:24523320). Does not affect APP trafficking from the endoplasmic reticulum to Golgi compartments (PubMed:17855360). Sorting receptor for the BDNF receptor NTRK2/TRKB that facilitates NTRK2 trafficking between synaptic plasma membranes, postsynaptic densities and cell soma, hence positively regulates BDNF signaling by controlling the intracellular location of its receptor (PubMed:23977241). Sorting receptor for GDNF that promotes GDNF regulated, but not constitutive secretion (PubMed:21994944). Sorting receptor for the GDNF-GFRA1 complex, directing it from the cell surface to endosomes. GDNF is then targeted to lysosomes and degraded, while its receptor GFRA1 recycles back to the cell membrane, resulting in a GDNF clearance pathway. The SORL1-GFRA1 complex further targets RET for endocytosis, but not for degradation, affecting GDNF-induced neurotrophic activities (PubMed:23333276). Sorting receptor for ERBB2/HER2. Regulates ERBB2 subcellular distribution by promoting its recycling after internalization from endosomes back to the plasma membrane, hence stimulating phosphoinositide 3-kinase (PI3K)-dependent ERBB2 signaling. In ERBB2-dependent cancer cells, promotes cell proliferation (PubMed:31138794). Sorting receptor for lipoprotein lipase LPL. Promotes LPL localization to endosomes and later to the lysosomes, leading to degradation of newly synthesized LPL (PubMe', '{}', '{}', '{}', '{}', '{}', '908792cfc12f0bf4de3953bd26975375', '2026-01-07 09:25:06.38424+00', '2026-01-07 09:25:01.801788+00'), ('4d83ae57-7a9f-42e4-913d-01d63b98033f', null, 'Q15116', 'PDCD1', 'ENST00000334409.10', 'Programmed cell death protein 1', 'Homo sapiens', 'Inhibitory receptor on antigen activated T-cells that plays a critical role in induction and maintenance of immune tolerance to self (PubMed:21276005, PubMed:37208329). Delivers inhibitory signals upon binding to ligands CD274/PDCD1L1 and CD273/PDCD1LG2 (PubMed:21276005). Following T-cell receptor (TCR) engagement, PDCD1 associates with CD3-TCR in the immunological synapse and directly inhibits T-cell activation (By similarity). Suppresses T-cell activation through the recruitment of PTPN11/SHP-2: following ligand-binding, PDCD1 is phosphorylated within the ITSM motif, leading to the recruitment of the protein tyrosine phosphatase PTPN11/SHP-2 that mediates dephosphorylation of key TCR proximal signaling molecules, such as ZAP70, PRKCQ/PKCtheta and CD247/CD3zeta (By similarity)', '{}', '{}', '{}', '{}', '{"pdb": ["2M2D", "3RRQ", "4ZQK", "5B8C", "5GGR", "5GGS", "5IUS", "5JXE", "5WT9", "6HIG", "6J14", "6J15", "6JBT", "6JJP", "6K0Y", "6R5G", "6ROY", "6ROZ", "6UMT", "6UMU", "6UMV", "6XKR", "7BXA", "7CGW", "7CU5", "7E9B", "7VUX", "7WSL", "7WVM", "8AS0", "8EQ6", "8GY5", "8U31", "8U32", "9HK1"], "hgnc": "HGNC:8760", "ensembl": ["ENST00000334409.10", "ENST00000618185.3"], "ncbi_gene": "5133"}', 'dd2295571b84a621', '2026-01-07 01:48:31.517923+00', '2026-01-07 01:48:31.517914+00'), ('6dce4629-4057-4917-a25b-3b8ce19d6bee', null, 'P16410', 'CTLA4', 'ENST00000295854.10', 'Cytotoxic T-lymphocyte protein 4', 'Homo sapiens', 'Inhibitory receptor acting as a major negative regulator of T-cell responses. The affinity of CTLA4 for its natural B7 family ligands, CD80 and CD86, is considerably stronger than the affinity of their cognate stimulatory coreceptor CD28', '{}', '{}', '{}', '{}', '{"pdb": ["1AH1", "1H6E", "1I85", "1I8L", "2X44", "3BX7", "3OSK", "5GGV", "5TRU", "5XJ3", "6RP8", "6RPJ", "6RQM", "6XY2", "7CIO", "7DV4", "7ELX", "7SU0", "7SU1", "8GAB", "8HIT", "9DQ3"], "hgnc": "HGNC:2505", "ensembl": ["ENST00000295854.10", "ENST00000487393.1", "ENST00000648405.2"], "ncbi_gene": "1493"}', 'c162d8d83dad82ca', '2026-01-07 01:48:35.564956+00', '2026-01-07 01:48:35.564949+00'), ('6df4bd3f-b98c-4012-b4a6-bf996f89c613', null, 'P20963', 'CD247', 'ENST00000362089.10', 'T-cell surface glycoprotein CD3 zeta chain', 'Homo sapiens', 'Part of the TCR-CD3 complex present on T-lymphocyte cell surface that plays an essential role in adaptive immune response. When antigen presenting cells (APCs) activate T-cell receptor (TCR), TCR-mediated signals are transmitted across the cell membrane by the CD3 chains CD3D, CD3E, CD3G and CD3Z. All CD3 chains contain immunoreceptor tyrosine-based activation motifs (ITAMs) in their cytoplasmic domain. Upon TCR engagement, these motifs become phosphorylated by Src family protein tyrosine kinases LCK and FYN, resulting in the activation of downstream signaling pathways (PubMed:1384049, PubMed:1385158, PubMed:2470098, PubMed:7509083). CD3Z ITAMs phosphorylation creates multiple docking sites for the protein kinase ZAP70 leading to ZAP70 phosphorylation and its conversion into a catalytically active enzyme (PubMed:7509083). Plays an important role in intrathymic T-cell differentiation. Additionally, participates in the activity-dependent synapse formation of retinal ganglion cells (RGCs) in both the retina and dorsal lateral geniculate nucleus (dLGN) (By similarity)', '{}', '{}', '{}', '{}', '{"pdb": ["1TCE", "1YGR", "2HAC", "2OQ1", "3IK5", "3IOZ", "4XZ1", "6JXR", "7FJD", "7FJE", "7FJF", "7PHR", "8ES7", "8ES8", "8ES9", "8J8I", "8JC0", "8JCB", "8TW4", "8TW6", "8WXE", "8WY0", "8WYI", "8YC0", "9BBC", "9C3E", "9CI8", "9CIA", "9CQ4"], "hgnc": "HGNC:1677", "ensembl": ["ENST00000362089.10", "ENST00000392122.4"], "ncbi_gene": "919"}', 'b9efcb96539894c1', '2026-01-07 01:48:20.212044+00', '2026-01-07 01:48:20.212034+00'), ('6e06e11f-f51d-48e5-8665-90d8e2a38ed2', null, 'P24593', 'IGFBP5', null, 'Insulin-like growth factor-binding protein 5', 'Homo sapiens', 'Multifunctional protein that plays a critical role in regulating the availability of IGFs to their receptors and thereby regulates IGF-mediated cellular processes including proliferation, differentiation, and apoptosis in a cell-type specific manner (PubMed:18930415, PubMed:7683690). Increases the cell proliferation of osteoblasts, intestinal smooth muscle cells and neuroblastoma cells. Enhances adhesion and survival of epithelial cells but decreases adhesion of mesenchymal cells (By similarity). Once secreted, acts as a major mediator of mTORC1-dependent feedback inhibition of IGF1 signaling (By similarity). Also plays a role in the induction of extracellular matrix (ECM) production and deposition independently of its nuclear translocation and binding to IGFs (PubMed:20345844, PubMed:26103640). Acts itself as a growth factor that can act independently of IGFs to regulate bone formation. Acts as a ligand for the ROR1 receptor which triggers formation of ROR1/HER2 heterodimer to enhance CREB oncogenic signaling (PubMed:36949068)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL2665"], "DrugBank": ["DB01277"]}', '2c994e24881934d4c6e8c5a6fbb29bc2', '2026-01-07 09:25:06.023585+00', '2026-01-07 09:25:01.455705+00'), ('71a9a306-2583-4649-9887-b8d40b29c652', null, 'A0A8A0Y2Q6', 'HER2', null, 'receptor protein-tyrosine kinase', 'Homo sapiens', '', '{}', '{}', '{}', '{}', '{}', 'ff174c10b9bfe481dfe3f7e33e193a98', '2026-01-07 09:25:08.507948+00', '2026-01-07 09:25:03.950443+00'), ('720b6f65-b5f2-4f7e-8ef9-42f8c55c39cf', null, 'A0A7T8JKQ4', 'ERBB2', 'ENSG00000141736', '', 'Homo sapiens', '', '{}', '[{"score": 0.756830139646167, "disease_id": "EFO_0003060", "disease_name": "non-small cell lung carcinoma", "datatype_scores": [{"id": "known_drug", "score": 0.9445005973126239}, {"id": "affected_pathway", "score": 0.607930797611621}, {"id": "literature", "score": 0.9888978664459614}, {"id": "somatic_mutation", "score": 0.7146798416120598}]}, {"score": 0.7317367232916838, "disease_id": "MONDO_0004992", "disease_name": "cancer", "datatype_scores": [{"id": "known_drug", "score": 0.6108448122207839}, {"id": "affe