: "known_drug", "score": 0.12158615952232422}, {"id": "affected_pathway", "score": 0.8372509142179835}, {"id": "somatic_mutation", "score": 0.607930797611621}]}, {"score": 0.46976770495775616, "disease_id": "EFO_1000172", "disease_name": "cervical squamous cell carcinoma", "datatype_scores": [{"id": "literature", "score": 0.2483415863191789}, {"id": "somatic_mutation", "score": 0.6137708014546894}]}, {"score": 0.4693664154495713, "disease_id": "MONDO_0016596", "disease_name": "hyperphosphatasia-intellectual disability syndrome", "datatype_scores": [{"id": "genetic_association", "score": 0.7720721129667588}]}, {"score": 0.46641252510560094, "disease_id": "EFO_0002892", "disease_name": "thyroid carcinoma", "datatype_scores": [{"id": "known_drug", "score": 0.6488816916174039}, {"id": "literature", "score": 0.19550121657303182}, {"id": "somatic_mutation", "score": 0.4559480982087158}]}]', '{}', '{}', '{}', '2976fb69f4d1d4a35ca98256aaf099ad', '2026-01-07 09:25:08.844694+00', '2026-01-07 10:10:51.769013+00'), ('72acac3b-cd12-4e72-8a09-a24bab269ecd', null, 'P08637', 'FCGR3A', 'ENST00000367967.8', 'Low affinity immunoglobulin gamma Fc region receptor III-A', 'Homo sapiens', 'Receptor for the invariable Fc fragment of immunoglobulin gamma (IgG). Optimally activated upon binding of clustered antigen-IgG complexes displayed on cell surfaces, triggers lysis of antibody-coated cells, a process known as antibody-dependent cellular cytotoxicity (ADCC). Does not bind free monomeric IgG, thus avoiding inappropriate effector cell activation in the absence of antigenic trigger (PubMed:11711607, PubMed:21768335, PubMed:22023369, PubMed:24412922, PubMed:25786175, PubMed:25816339, PubMed:28652325, PubMed:8609432, PubMed:9242542). Mediates IgG effector functions on natural killer (NK) cells. Binds antigen-IgG complexes generated upon infection and triggers NK cell-dependent cytokine production and degranulation to limit viral load and propagation. Involved in the generation of memory-like adaptive NK cells capable to produce high amounts of IFNG and to efficiently eliminate virus-infected cells via ADCC (PubMed:24412922, PubMed:25786175). Regulates NK cell survival and proliferation, in particular by preventing NK cell progenitor apoptosis (PubMed:29967280, PubMed:9916693). Fc-binding subunit that associates with CD247 and/or FCER1G adapters to form functional signaling complexes. Following the engagement of antigen-IgG complexes, triggers phosphorylation of immunoreceptor tyrosine-based activation motif (ITAM)-containing adapters with subsequent activation of phosphatidylinositol 3-kinase signaling and sustained elevation of intracellular calcium that ultimately drive NK cell activation. The ITAM-dependent signaling coupled to receptor phosphorylation by PKC mediates robust intracellular calcium flux that leads to production of pro-inflammatory cytokines, whereas in the absence of receptor phosphorylation it mainly activates phosphatidylinositol 3-kinase signaling leading to cell degranulation (PubMed:1825220, PubMed:23024279, PubMed:2532305). Costimulates NK cells and trigger lysis of target cells independently of IgG binding (PubMed:10318937, PubMed:23006327). Mediates the antitumor activities of therapeutic antibodies. Upon ligation on monocytes triggers TNFA-dependent ADCC of IgG-coated tumor cells (PubMed:27670158). Mediates enhanced ADCC in response to afucosylated IgGs (PubMed:34485821)', '{}', '{}', '{}', '{}', '{"pdb": ["3AY4", "3SGJ", "3SGK", "3WN5", "5BW7", "5D6D", "5ML9", "5MN2", "5VU0", "5XJE", "5XJF", "5YC5", "7SEG", "7URU"], "hgnc": "HGNC:3619", "ensembl": ["ENST00000367967.8", "ENST00000436743.7", "ENST00000443193.6", "ENST00000699395.1", "ENST00000699396.1", "ENST00000699397.1"], "ncbi_gene": "2214"}', '27cb5db119eca0ed', '2026-01-07 01:48:18.224364+00', '2026-01-07 01:48:18.224355+00'), ('7322b667-2a0d-49c8-9596-12eec329bed2', null, 'P07858', 'CTSB', 'ENST00000345125.8', 'Cathepsin B', 'Homo sapiens', 'Thiol protease which is beli