e_name": "neoplasm of mature B-cells", "datatype_scores": [{"id": "known_drug", "score": 0.6626065428955613}]}, {"score": 0.39136197680183055, "disease_id": "MONDO_0007915", "disease_name": "systemic lupus erythematosus", "datatype_scores": [{"id": "literature", "score": 0.3287048048752835}, {"id": "known_drug", "score": 0.6273254942664385}]}, {"score": 0.3848653235135216, "disease_id": "EFO_0003086", "disease_name": "kidney disease", "datatype_scores": [{"id": "literature", "score": 0.04196901721755704}, {"id": "known_drug", "score": 0.6309757823010917}]}, {"score": 0.37895657303282676, "disease_id": "EFO_0004991", "disease_name": "Myasthenia gravis", "datatype_scores": [{"id": "known_drug", "score": 0.6123720698275059}, {"id": "literature", "score": 0.21965434926944488}]}, {"score": 0.378415131390056, "disease_id": "EFO_0004254", "disease_name": "membranous glomerulonephritis", "datatype_scores": [{"id": "literature", "score": 0.11844080440184761}, {"id": "known_drug", "score": 0.6165421166818713}]}, {"score": 0.37760200334538807, "disease_id": "EFO_0005761", "disease_name": "lupus nephritis", "datatype_scores": [{"id": "known_drug", "score": 0.6165421166818713}, {"id": "literature", "score": 0.09169012659896204}]}]', '{}', '{}', '{"ChEMBL": ["CHEMBL2058"], "DrugBank": ["DB16672", "DB16371", "DB00078", "DB15434", "DB08935", "DB11988", "DB16684", "DB06650", "DB00073", "DB09336", "DB00081", "DB11850"]}', '1ede3b832a1031a3e4021090d74148d3', '2026-01-07 01:48:16.117822+00', '2026-01-08 02:09:10.879516+00'), ('87bc830a-3fb1-4d6f-947b-221aa18740af', null, 'Q9H9Z2', 'LIN28A', null, 'Protein lin-28 homolog A', 'Homo sapiens', 'RNA-binding protein that inhibits processing of pre-let-7 miRNAs and regulates translation of mRNAs that control developmental timing, pluripotency and metabolism (PubMed:21247876). Seems to recognize a common structural G-quartet (G4) feature in its miRNA and mRNA targets (Probable). ''Translational enhancer'' that drives specific mRNAs to polysomes and increases the efficiency of protein synthesis. Its association with the translational machinery and target mRNAs results in an increased number of initiation events per molecule of mRNA and, indirectly, in mRNA stabilization. Binds IGF2 mRNA, MYOD1 mRNA, ARBP/36B4 ribosomal protein mRNA and its own mRNA. Essential for skeletal muscle differentiation program through the translational up-regulation of IGF2 expression. Suppressor of microRNA (miRNA) biogenesis, including that of let-7, miR107, miR-143 and miR-200c. Specifically binds the miRNA precursors (pre-miRNAs), recognizing an 5''-GGAG-3'' motif found in pre-miRNA terminal loop, and recruits TUT4 and TUT7 uridylyltransferases (PubMed:18951094, PubMed:19703396, PubMed:22118463, PubMed:22898984). This results in the terminal uridylation of target pre-miRNAs (PubMed:18951094, PubMed:19703396, PubMed:22118463, PubMed:22898984). Uridylated pre-miRNAs fail to be processed by Dicer and undergo degradation. The repression of let-7 expression is required for normal development and contributes to maintain the pluripotent state by preventing let-7-mediated differentiation of embryonic stem cells (PubMed:18951094, PubMed:19703396, PubMed:22118463, PubMed:22898984). Localized to the periendoplasmic reticulum area, binds to a large number of spliced mRNAs and inhibits the translation of mRNAs destined for the ER, reducing the synthesis of transmembrane proteins, ER or Golgi lumen proteins, and secretory proteins. Binds to and enhances the translation of mRNAs for several metabolic enzymes, such as PFKP, PDHA1 or SDHA, increasing glycolysis and oxidative phosphorylation. Which, wit', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL4523458"]}', '5e62949234f2b54706a61de95b8288db', '2026-01-07 09:25:04.866404+00', '2026-01-07 09:25:00.256603+00'), ('9b9ef0b7-8c8a-4992-b95e-dc0cebf63316', null, 'Q6ZN17', 'LIN28B', null, 'Protein lin-28 homolog B', 'Homo sapiens', 'Suppressor of microRNA (miRNA) biogenesis, including that of let-7 and possibly of miR107, miR-143 and miR-200c. Binds primary let-7 transcripts (pri-let-7), including pri-let-7g and pri-let-7a-1, and sequester them in the nucleolus, away from the microprocessor complex, hence preventing their processing into mature miRNA (PubMed:22118463). Does not act on pri-miR21 (PubMed:22118463). The repression of let-7 expression is required for normal development and contributes to maintain the pluripotent state of embryonic stem cells by preventing let-7-mediated differentiation. When overexpressed, recruits ZCCHC11/TUT4 uridylyltransferase to pre-let-7 transcripts, leading to their terminal uridylation and degradation (PubMed:19703396). This activity might not be relevant in vivo, as LIN28B-mediated inhibition of let-7 miRNA maturation appears to be ZCCHC11-independent (PubMed:22118463). Interaction with target pre-miRNAs occurs via an 5''-GGAG-3'' motif in the pre-miRNA terminal loop. Mediates MYC-induced let-7 repression (By similarity). When overexpressed, isoform 1 stimulates growth of the breast adenocarcinoma cell line MCF-7. Isoform 2 has no effect on cell growth', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL4295873"]}', '18b6956e93bab14fbf79e1f5cfebc3f4', '2026-01-07 09:25:03.349942+00', '2026-01-07 09:24:58.759995+00'), ('a4859a39-fa5c-42a5-869e-348b46dbcf1c', null, 'P20273', 'CD22', null, 'B-cell receptor CD22', 'Homo sapiens', 'Most highly expressed siglec (sialic acid-binding immunoglobulin-like lectin) on B-cells that plays a role in various aspects of B-cell biology including differentiation, antigen presentation, and trafficking to bone marrow (PubMed:34330755, PubMed:8627166). Binds to alpha 2,6-linked sialic acid residues of surface molecules such as CD22 itself, CD45 and IgM in a cis configuration. Can also bind to ligands on other cells as an adhesion molecule in a trans configuration (PubMed:20172905). Acts as an inhibitory coreceptor on the surface of B-cells and inhibits B-cell receptor induced signaling, characterized by inhibition of the calcium mobilization and cellular activation. Mechanistically, the immunoreceptor tyrosine-based inhibitory motif domain is phosphorylated by the Src kinase LYN, which in turn leads to the recruitment of the protein tyrosine phosphatase 1/PTPN6, leading to the negative regulation of BCR signaling (PubMed:8627166). If this negative signaling from is of sufficient strength, apoptosis of the B-cell can be induced (PubMed:20516366)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL3218"], "DrugBank": ["DB04958", "DB05889", "DB12688"]}', '8b46f93dcc3f28a813c99b9e9bf2d7d0', '2026-01-08 01:33:46.934878+00', '2026-01-08 02:09:12.328937+00'), ('a67e7e09-92f0-493d-aff9-e2dc6a3ea49a', null, 'P17948', 'FLT1', 'ENST00000282397.9', 'Vascular endothelial growth factor receptor 1', 'Homo sapiens', 'Tyrosine-protein kinase that acts as a cell-surface receptor for VEGFA, VEGFB and PGF, and plays an essential role in the development of embryonic vasculature, the regulation of angiogenesis, cell survival, cell migration, macrophage function, chemotaxis, and cancer cell invasion. Acts as a positive regulator of postnatal retinal hyaloid vessel regression (By similarity). May play an essential role as a negative regulator of embryonic angiogenesis by inhibiting excessive proliferation of endothelial cells. Can promote endothelial cell proliferation, survival and angiogenesis in adulthood. Its function in promoting cell proliferation seems to be cell-type specific. Promotes PGF-mediated proliferation of endothelial cells, proliferation of some types of cancer cells, but does not promote proliferation of normal fibroblasts (in vitro). Has very high affinity for VEGFA and relatively low protein kinase activity; may function as a negative regulator of VEGFA signaling by limiting the amount of free VEGFA and preventing its binding to KDR. Modulates KDR signaling by forming heterodimers with KDR. Ligand binding leads to the activation of several signaling cascades. Activation of PLCG leads to the production of the cellular signaling molecules diacylglycerol and inositol 1,4,5-trisphosphate and the activation of protein kinase C. Mediates phosphorylation of PIK3R1, the regulatory subunit of phosphatidylinositol 3-kinase, leading to activation of phosphatidylinositol kinase and the downstream signaling pathway. Mediates activation of MAPK1/ERK2, MAPK3/ERK1 and the MAP kinase signaling pathway, as well as of the AKT1 signaling pathway. Phosphorylates SRC and YES1, and may also phosphorylate CBL. Promotes phosphorylation of AKT1 at ''Ser-473''. Promotes phosphorylation of PTK2/FAK1 (PubMed:16685275)', '{}', '{}', '{}', '{}', '{"pdb": ["1FLT", "1QSV", "1QSZ", "1QTY", "1RV6", "2XAC", "3HNG", "4CKV", "4CL7", "5ABD", "5EX3", "5T89"], "hgnc": "HGNC:3763", "ensembl": ["ENST00000282397.9", "ENST00000539099.2", "ENST00000541932.5", "ENST00000615840.5"], "ncbi_gene": "2321"}', '455efde9d8047d4b', '2026-01-07 01:48:39.759327+00', '2026-01-07 01:48:39.759319+00'), ('b3e16c9f-c91d-48fb-b66d-ffc069c2d41a', null, 'Q01196', 'RUNX1', 'ENST00000300305.7', 'Runt-related transcription factor 1', 'Homo sapiens', 'Forms the heterodimeric complex core-binding factor (CBF) with CBFB. RUNX members modulate the transcription of their target genes through recognizing the core consensus binding sequence 5''-TGTGGT-3'', or very rarely, 5''-TGCGGT-3'', within their regulatory regions via their runt domain, while CBFB is a non-DNA-binding regulatory subunit that allosterically enhances the sequence-specific DNA-binding capacity of RUNX. The heterodimers bind to the core site of a number of enhancers and promoters, including murine leukemia virus, polyomavirus enhancer, T-cell receptor enhancers, LCK, IL3 and GM-CSF promoters (Probable). Essential for the development of normal hematopoiesis (PubMed:17431401). Acts synergistically with ELF4 to transactivate the IL-3 promoter and with ELF2 to transactivate the BLK promoter (PubMed:10207087, PubMed:14970218). Inhibits KAT6B-dependent transcriptional activation (By similarity). Involved in lineage commitment of immature T cell precursors. CBF complexes repress ZBTB7B transcription factor during cytotoxic (CD8+) T cell development. They bind to RUNX-binding sequence within the ZBTB7B locus acting as transcriptional silencer and allowing for cytotoxic T cell differentiation. CBF complexes binding to the transcriptional silencer is essential for recruitment of nuclear protein complexes that catalyze epigenetic modifications to establish epigenetic ZBTB7B silencing (By similarity). Controls the anergy and suppressive function of regulatory T-cells (Treg) by associating with FOXP3. Activates the expression of IL2 and IFNG and down-regulates the expression of TNFRSF18, IL2RA and CTLA4, in conventional T-cells (PubMed:17377532). Positively regulates the expression of RORC in T-helper 17 cells (By similarity)', '{}', '{}', '{}', '{}', '{"pdb": ["1CMO", "1CO1", "1E50", "1H9D", "1LJM"], "hgnc": "HGNC:10471", "ensembl": ["ENST00000300305.7", "ENST00000344691.8", "ENST00000358356.9", "ENST00000675419.1"], "ncbi_gene": "861"}', '3eeb81424b73aed2', '2026-01-07 01:48:46.470225+00', '2026-01-07 01:48:46.470218+00'), ('b6eea6db-9132-4119-899e-92f8f188f083', null, 'Q15303', 'ERBB4', 'ENST00000260943.11', 'Receptor tyrosine-protein kinase erbB-4', 'Homo sapiens', 'Tyrosine-protein kinase that plays an essential role as cell surface receptor for neuregulins and EGF family members and regulates development of the heart, the central nervous system and the mammary gland, gene transcription, cell proliferation, differentiation, migration and apoptosis. Required for normal cardiac muscle differentiation during embryonic development, and for postnatal cardiomyocyte proliferation. Required for normal development of the embryonic central nervous system, especially for normal neural crest cell migration and normal axon guidance. Required for mammary gland differentiation, induction of milk proteins and lactation. Acts as cell-surface receptor for the neuregulins NRG1, NRG2, NRG3 and NRG4 and the EGF family members BTC, EREG and HBEGF. Ligand binding triggers receptor dimerization and autophosphorylation at specific tyrosine residues that then serve as binding sites for scaffold proteins and effectors. Ligand specificity and signaling is modulated by alternative splicing, proteolytic processing, and by the formation of heterodimers with other ERBB family members, thereby creating multiple combinations of intracellular phosphotyrosines that trigger ligand- and context-specific cellular responses. Mediates phosphorylation of SHC1 and activation of the MAP kinases MAPK1/ERK2 and MAPK3/ERK1. Isoform JM-A CYT-1 and isoform JM-B CYT-1 phosphorylate PIK3R1, leading to the activation of phosphatidylinositol 3-kinase and AKT1 and protect cells against apoptosis. Isoform JM-A CYT-1 and isoform JM-B CYT-1 mediate reorganization of the actin cytoskeleton and promote cell migration in response to NRG1. Isoform JM-A CYT-2 and isoform JM-B CYT-2 lack the phosphotyrosine that mediates interaction with PIK3R1, and hence do not phosphorylate PIK3R1, do not protect cells against apoptosis, and do not promote reorganization of the actin cytoskeleton and cell migration. Proteolytic processing of isoform JM-A CYT-1 and isoform JM-A CYT-2 gives rise to the co', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL3009"], "DrugBank": ["DB08916", "DB12267", "DB05424", "DB12744", "DB11963", "DB12010", "DB12325", "DB15035"]}', 'f559b5c4a5c5165ad5d4af8677c7e59e', '2026-01-07 01:48:14.358546+00', '2026-01-07 09:25:03.225141+00'), ('c7a93fcc-c411-4364-959f-4fd47a312a3c', null, 'P09758', 'TACSTD2', null, 'Tumor-associated calcium signal transducer 2', 'Homo sapiens', 'May function as a growth factor receptor', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL3856163"], "DrugBank": ["DB12893"]}', 'eb273db0aa2f6b0f24080d0c8d8d8c75', '2026-01-08 01:33:44.940848+00', '2026-01-08 02:09:10.129563+00'), ('d8f286b7-d36e-4c55-bc2e-5bb606723ecd', null, 'Q99808', 'SLC29A1', 'ENST00000371708.1', 'Equilibrative nucleoside transporter 1', 'Homo sapiens', 'Uniporter involved in the facilitative transport of nucleosides and nucleobases, and contributes to maintaining their cellular homeostasis (PubMed:10722669, PubMed:10755314, PubMed:12527552, PubMed:14759222, PubMed:15037197, PubMed:17379602, PubMed:21795683, PubMed:26406980, PubMed:27995448, PubMed:35790189, PubMed:8986748). Functions as a Na(+)-independent transporter (PubMed:8986748). Involved in the transport of nucleosides such as adenosine, guanosine, inosine, uridine, thymidine and cytidine (PubMed:10722669, PubMed:10755314, PubMed:12527552, PubMed:14759222, PubMed:15037197, PubMed:17379602, PubMed:26406980, PubMed:8986748). Also transports purine nucleobases (hypoxanthine, adenine, guanine) and pyrimidine nucleobases (thymine, uracil) (PubMed:21795683, PubMed:27995448). Mediates basolateral nucleoside uptake into Sertoli cells, thereby regulating the transport of nucleosides in testis across the blood-testis barrier (By similarity). Regulates inosine levels in brown adipocytes tissues (BAT) and extracellular inosine levels, which controls BAT-dependent energy expenditure (PubMed:35790189)', '{}', '{}', '{}', '{}', '{"pdb": ["6OB6", "6OB7", "8TZI"], "hgnc": "HGNC:11003", "ensembl": ["ENST00000371708.1", "ENST00000371713.6", "ENST00000371724.6", "ENST00000371755.9", "ENST00000393844.7", "ENST00000651428.1", "ENST00000652453.1", "ENST00000652680.1"], "ncbi_gene": "2030"}', 'ca25f9e601bbc62f', '2026-01-07 01:48:27.758011+00', '2026-01-07 01:48:27.758003+00'), ('dc0310b8-c418-48b2-91bc-63014d13b375', null, 'Q14451', 'GRB7', null, 'Growth factor receptor-bound protein 7', 'Homo sapiens', 'Adapter protein that interacts with the cytoplasmic domain of numerous receptor kinases and modulates down-stream signaling. Promotes activation of down-stream protein kinases, including STAT3, AKT1, MAPK1 and/or MAPK3. Promotes activation of HRAS. Plays a role in signal transduction in response to EGF. Plays a role in the regulation of cell proliferation and cell migration. Plays a role in the assembly and stability of RNA stress granules. Binds to the 5''UTR of target mRNA molecules and represses translation of target mRNA species, when not phosphorylated. Phosphorylation impairs RNA binding and promotes stress granule disassembly during recovery after cellular stress (By similarity)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL1649051"]}', '4ff66448d09993922720bae18d6a5ba4', '2026-01-07 09:25:07.455335+00', '2026-01-07 09:25:02.831134+00'), ('dfc9949d-a3d6-4a68-9f86-42d96c5dfb14', null, 'P98177', 'FOXO4', null, 'Forkhead box protein O4', 'Homo sapiens', 'Transcription factor involved in the regulation of the insulin signaling pathway. Binds to insulin-response elements (IREs) and can activate transcription of IGFBP1. Down-regulates expression of HIF1A and suppresses hypoxia-induced transcriptional activation of HIF1A-modulated genes. Also involved in negative regulation of the cell cycle. Involved in increased proteasome activity in embryonic stem cells (ESCs) by activating expression of PSMD11 in ESCs, leading to enhanced assembly of the 26S proteasome, followed by higher proteasome activity', '{}', '{}', '{}', '{}', '{}', '367b43925b53e1691a3c7f345da8d3f7', '2026-01-07 09:25:04.478357+00', '2026-01-07 09:24:59.899796+00'), ('e058aaa1-f1e1-4d60-b8c5-d0df0b052091', null, 'Q7Z3Q1', 'SLC46A3', null, 'Lysosomal proton-coupled steroid conjugate and bile acid symporter SLC46A3', 'Homo sapiens', 'Lysosomal proton-coupled steroid conjugate and bile acid transporter. Preferentially recognizes lipophilic steroid conjugates or bile acis as endogenous substrates and seems to mediate escape from lysosomes to the cytoplasm (PubMed:36741448). Modulates hepatic cytosolic copper homeostasis, maybe acting as a lysosomal copper transporter and sequestering copper ions in the lysosome (By similarity). Transports catabolites of non-cleavable antibody-drug conjugates from the lysosome to the cytoplasm (PubMed:26631267, PubMed:30131388, PubMed:36741448). Delivers pathogen-associated molecular patterns to cytosolic pattern recognition receptors as part of the innate immune response to microbes. Selectively transports bacterial muramyl dipeptide (MDP) into the cytosol for recognition by NOD2, triggering inflammatory responses (By similarity). Likely acts as a redundant importer of cyclic GMP-AMP dinucleotides (cGAMPs) in monocyte and macrophage cell lineages (PubMed:34235268). The transport mechanism, its electrogenicity and stoichiometry remain to be elucidated (Probable)', '{}', '{}', '{}', '{}', '{}', '2736ca011bb24abef8c075dc2da3a7b4', '2026-01-07 09:53:46.054944+00', '2026-01-07 09:53:45.919966+00'), ('e0afb6e2-b0dd-4960-bea8-fda2c33a602c', null, 'Q16288', 'NTRK3', 'ENST00000317501.9', 'NT-3 growth factor receptor', 'Homo sapiens', 'Receptor tyrosine kinase involved in nervous system and probably heart development. Upon binding of its ligand NTF3/neurotrophin-3, NTRK3 autophosphorylates and activates different signaling pathways, including the phosphatidylinositol 3-kinase/AKT and the MAPK pathways, that control cell survival and differentiation', '{}', '{}', '{}', '{}', '{"pdb": ["1WWC", "3V5Q", "4YMJ", "6KZC", "6KZD"], "hgnc": "HGNC:8033", "ensembl": ["ENST00000317501.9", "ENST00000357724.6", "ENST00000394480.6", "ENST00000557856.5", "ENST00000629765.3", "ENST00000695462.1"], "ncbi_gene": "4916"}', '172c054acad9fe74', '2026-01-07 01:48:41.779348+00', '2026-01-07 01:48:41.77934+00'), ('e94e0c85-b844-41fe-ad94-4c00a34f4c9e', null, 'O75368', 'SH3BGRL', null, 'Adapter SH3BGRL', 'Homo sapiens', 'Appears to function as an adapter protein that bridges proteins together or proteins with mRNAs (PubMed:34331014). May function as a ubiquitin ligase-substrate adapter (PubMed:34331014, PubMed:34870550). Additionally, associates with translating cytoplasmic ribosomes and may promote the expression of specific mRNAs (PubMed:34331014, PubMed:34870550)', '{}', '{}', '{}', '{}', '{}', '309e2ad224bf62ae4dc1dd784f44adab', '2026-01-07 09:25:02.977265+00', '2026-01-07 09:24:58.408473+00'), ('eacd1411-1319-404f-b9c4-8076257e8d70', null, 'Q9HAP6', 'LIN7B', null, 'Protein lin-7 homolog B', 'Homo sapiens', 'Plays a role in establishing and maintaining the asymmetric distribution of channels and receptors at the plasma membrane of polarized cells. Forms membrane-associated multiprotein complexes that may regulate delivery and recycling of proteins to the correct membrane domains. The tripartite complex composed of LIN7 (LIN7A, LIN7B or LIN7C), CASK and APBA1 associates with the motor protein KIF17 to transport vesicles containing N-methyl-D-aspartate (NMDA) receptor subunit NR2B along microtubules (By similarity). This complex may have the potential to couple synaptic vesicle exocytosis to cell adhesion in brain. Ensures the proper localization of GRIN2B (subunit 2B of the NMDA receptor) to neuronal postsynaptic density and may function in localizing synaptic vesicles at synapses where it is recruited by beta-catenin and cadherin. Required to localize Kir2 channels, GABA transporter (SLC6A12) and EGFR/ERBB1, ERBB2, ERBB3 and ERBB4 to the basolateral membrane of epithelial cells. May increase the amplitude of ASIC3 acid-evoked currents by stabilizing the channel at the cell surface (By similarity)', '{}', '{}', '{}', '{}', '{}', '09c716a690d327b3b6e94da4a90ede3e', '2026-01-07 09:25:05.273488+00', '2026-01-07 09:25:00.662076+00'), ('ed451495-af36-46e1-8fa3-e99aa57b9f54', null, 'P15391', 'CD19', null, 'B-lymphocyte antigen CD19', 'Homo sapiens', 'Functions as a coreceptor for the B-cell antigen receptor complex (BCR) on B-lymphocytes (PubMed:29523808). Decreases the threshold for activation of downstream signaling pathways and for triggering B-cell responses to antigens (PubMed:1373518, PubMed:16672701, PubMed:2463100). Activates signaling pathways that lead to the activation of phosphatidylinositol 3-kinase and the mobilization of intracellular Ca(2+) stores (PubMed:12387743, PubMed:16672701, PubMed:9317126, PubMed:9382888). Is not required for early steps during B cell differentiation in the blood marrow (PubMed:9317126). Required for normal differentiation of B-1 cells (By similarity). Required for normal B cell differentiation and proliferation in response to antigen challenges (PubMed:1373518, PubMed:2463100). Required for normal levels of serum immunoglobulins, and for production of high-affinity antibodies in response to antigen challenge (PubMed:12387743, PubMed:16672701, PubMed:9317126)', '{}', '{}', '{}', '{}', '{"ChEMBL": ["CHEMBL3390821"], "DrugBank": ["DB13915", "DB09052", "DB15699", "DB06342", "DB11731", "DB12530", "DB16582", "DB16222", "DB15044", "DB13881"]}', '1eed2bdc0a5089f1357a27cbf42f75cc', '2026-01-08 01:33:45.286409+00', '2026-01-08 02:09:10.526751+00'), ('f3ba63de-f3ad-4b7b-b1c2-f0ae10e0513c', null, 'Q96RT1', 'ERBIN', null, 'Erbin', 'Homo sapiens', 'Acts as an adapter for the receptor ERBB2, in epithelia. By binding the unphosphorylated ''Tyr-1248'' of receptor ERBB2, it may contribute to stabilize this unphosphorylated state (PubMed:16203728). Inhibits NOD2-dependent NF-kappa-B signaling and pro-inflammatory cytokine secretion (PubMed:16203728)', '{}', '{}', '{}', '{}', '{}', '25be3f9e4ccae4b3e8b412cbd59ab1d1', '2026-01-07 09:25:07.066831+00', '2026-01-07 09:25:02.496778+00'), ('ff457d19-cc21-4580-9e27-970fba8a7420', null, 'Q9NUP9', 'LIN7C', null, 'Protein lin-7 homolog C', 'Homo sapiens', 'Plays a role in establishing and maintaining the asymmetric distribution of channels and receptors at the plasma membrane of polarized cells. Forms membrane-associated multiprotein complexes that may regulate delivery and recycling of proteins to the correct membrane domains. The tripartite complex composed of LIN7 (LIN7A, LIN7B or LIN7C), CASK and APBA1 associates with the motor protein KIF17 to transport vesicles containing N-methyl-D-aspartate (NMDA) receptor subunit NR2B along microtubules (By similarity). This complex may have the potential to couple synaptic vesicle exocytosis to cell adhesion in brain. Ensures the proper localization of GRIN2B (subunit 2B of the NMDA receptor) to neuronal postsynaptic density and may function in localizing synaptic vesicles at synapses where it is recruited by beta-catenin and cadherin. Required to localize Kir2 channels, GABA transporter (SLC6A12) and EGFR/ERBB1, ERBB2, ERBB3 and ERBB4 to the basolateral membrane of epithelial cells', '{}', '{}', '{}', '{}', '{}', '992edfecc62eed759634179426b6b297', '2026-01-07 09:25:04.136183+00', '2026-01-07 09:24:59.538992+00');